:root {
  --blue: #0067b8;
  --darkblue: #015fa7;
  --orange: #ffb900;
  --darkgray: #262626;
  --lightgray: #f2f2f2;
  --gray: #616161;
  --white: #fff;
}
* {
  box-sizing: border-box;
}
body {
  line-height: 1.5;
  font-weight: 400;
  overflow-x: hidden;
}
.container {
  max-width: 1440px;
  margin-inline: auto;
  // display: flex;
}
.navigator {
  // max-width: 1700px;
  // display: flex;
  // padding: 0 0 0 8%;
  .container {
    display: flex;
  }
  .nav_logo {
    margin: 1px 0 0;
    padding: 16px 22px 16px 10px;
    img {
      width: 108px;
      height: 23px;
      margin: -3px 0 0;
    }
  }
  .menu_items {
    width: 70%;
    padding-bottom: 8px;
    display: flex;
    align-items: center;
    font-size: 13px;
    li {
      padding: 16px 14px 10px;
      a {
        color: var(--darkgray);
        text-decoration: none;
      }
    }
    li:hover {
      margin-bottom: 1px;
      text-decoration: underline 2px;
    }
  }
  .actions {
    display: flex;
    align-items: center;
    gap: 6px;
    // padding-top: 12px;
    font-size: 13px;
    a {
      text-decoration: none;
      color: var(--darkgray);
      display: flex;
      align-items: center;
      gap: 2px;
    }
    a:hover {
      text-decoration: underline 2px;
    }
    .ms_all_nav {
      // padding-right: 16px;
    }
    .shopping_cart {
      // padding-right: 16px;
    }
    .login {
    }
  }
}
.main_image {
  .container {
    max-width: 1920px;
    // background: url('./images/Highlight-Surface-Pro-9-M1-Family-02-1_VP5-1920x600.avif')
    //   no-repeat;
    // background-size: cover;
    // background-position: 10% 0;
    cursor: pointer;
    position: relative;
    .main_foreground {
      .inner_text {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translateY(-60%) translateX(35%);
        width: 500px;
        .badge {
          background-color: var(--orange);
          display: inline-block;
          font-weight: 600;
          line-height: 1;
          padding: 8px 12px;
        }
        h1 {
          font-size: 32px;
          font-weight: 900;
          margin-top: 8px;
          margin-bottom: 16px;
        }
        p {
          font-size: 16px;
          margin-bottom: 20px;
        }
        .main-image-btn {
          a {
            text-decoration: none;
            color: var(--white);
          }
          outline: none;
          padding: 8px 16px;
          background-color: var(--blue);
          color: var(--white);
          border: 0px;
          border-radius: 2px;
          font-weight: 600;
          cursor: pointer;
          font-size: 15px;
        }
        .main-image-btn:hover {
          background-color: var(--darkblue);
        }
      }
    }

    img {
      width: 100%;
    }
  }
}
.link_list {
  margin: 0 auto;
  ul {
    display: flex;
    padding: 60px 75px;
    justify-content: center;
    li {
      margin: 16px 24px;
      .link-img {
        text-align: center;
      }
      a {
        color: var(--blue);
        font-weight: 700;
      }
    }
  }
}
.card_layout {
  height: 500px;
  // .container {
  //   width: 90%;
  //
  .inner {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    .card {
      position: relative;
      width: 100%;
      .badge {
        background-color: var(--orange);
        display: inline-block;
        font-weight: 600;
        line-height: 1;
        padding: 8px 12px;
        position: relative;
      }
      h2 {
        font-size: 29px;
        font-weight: 700;
        margin-top: 30px;
        &.first {
          margin-top: 0;
        }
      }
      p {
        line-height: 1.5;
        word-break: keep-all;
        width: 320px;
      }
      .footer {
        background-color: transparent;
        margin: 16px 0 0 0;
        a {
          text-decoration: none;
          color: var(--blue);
          font-weight: 700;
        }
      }
      .footer {
        a {
          // display: flex;
          // align-items: center;
          &:hover {
            transition: transform 0.2s ease-in;
            text-decoration: underline;
            span {
              transform: translateX(10px);
            }
          }
        }
      }
    }
  }
  .card_img {
    width: 320px;
    height: 180px;
    h2 {
      font-size: 29px;
      font-weight: 600;
      margin: 16px 0;
    }
    p {
      font-size: 16px;
      font-weight: 400;
      line-height: 1.5;
    }
  }
}
