.one-container {
  position: relative;
  cursor: pointer;
  // padding: 0 150px;
  .card-background {
    img {
      width: 97%;
    }
  }
  .card-text {
    width: 450px;
    left: 25%;
    position: absolute;
    top: 50%;
    transform: translate(-40%, -50%);
    h1 {
      font-size: 32px;
      font-weight: 800;
      margin-bottom: 20px;
    }
    p {
      font-size: 16px;
      margin-bottom: 20px;
    }
    .onedrive-btn {
      outline: none;
      padding: 8px 16px;
      background-color: var(--blue);
      color: var(--white);
      border: 0px;
      border-radius: 2px;
      font-weight: 600;
      cursor: pointer;
      font-size: 15px;
    }
    .onedrive-btn:hover {
      background-color: var(--darkblue);
    }
  }
}
.follow_request {
  .container {
    display: flex;
    align-items: center;
    ul {
      display: flex;
      li {
        padding: 0 6px;
        img {
          width: 32px;
          height: 32px;
        }
      }
    }
  }
}
.move_top {
  position: fixed;
  display: none;
  // justify-content: flex-end;
  margin-right: 20px;
  text-align: center;
  bottom: 16px;
  right: 20px;
  .move_top_btn {
    font-weight: 600;
    padding: 10px 12px;
    border: 0px;
    border-radius: 2px;
    cursor: pointer;
    font-size: 16px;
  }
  .move_top_btn:hover {
    background-color: var(--white);
    box-shadow: 2px 2px 2px 2px gray;
  }
}
.footer {
  background-color: var(--lightgray);
  .more_info {
    display: flex;
    justify-content: space-between;
    p {
      color: var(--gray);
      font-size: 15px;
      padding: 36px 4px 16px 8px;
      font-weight: 600;
      line-height: 10px;
    }
    ul li {
      font-size: 11px;
      padding: 8px 8px 16px 8px;
      line-height: 8px;
    }
  }
  .base {
    color: var(--gray);
    padding: 30px 0 30px 0;
    justify-content: space-between;
    font-size: 11px;
    display: flex;
    .language {
      display: flex;
      align-items: center;
      a {
        text-decoration: none;
        color: var(--gray);
        display: flex;
        align-items: center;
        gap: 5px;
      }
      a:hover {
        text-decoration: underline;
      }
    }
    ul {
      display: flex;
      .bold {
        font-weight: 700;
      }
      li {
        padding: 0 24px 4px 0;
        justify-content: center;
      }
      a {
        text-decoration: none;
        color: var(--gray);
      }
      a:hover {
        text-decoration: underline;
      }
    }
  }
}

@media (max-width: 1440px) {
  .container {
    max-width: 1350px;
  }
}
